import React from "react";
import styled from "styled-components";

const Main = styled.div`
  width: 100%;
  height: 70vh;
  margin: 10vh 0;
  align-itens: center;
  align-self: center;
  background: green;
`;


export default function index() {
    return (
        <Main></Main>
    );
}
